mathml.elements.mfrac.code:
(function () {
  // Use tall enough fraction to avoid side effect of min num/denum shifts.
  var mathEl = document.createElementNS(
    "http://www.w3.org/1998/Math/MathML",
    "math",
  );
  mathEl.innerHTML =
    "<mfrac><mspace height='50px' depth='50px'></mspace><mspace height='50px' depth='50px'></mspace></mfrac><mfrac><mspace height='60px' depth='60px'></mspace><mspace height='60px' depth='60px'></mspace></mfrac>";
  document.getElementById("resources").appendChild(mathEl);
  bcd.addCleanup(function () {
    document.getElementById("resources").removeChild(mathEl);
  });

  var mfrac = mathEl.getElementsByTagName("mfrac");
  // height/depth will add 40px per MathML, 20px if mfrac does not stack its children and none if mspace is not supported.
  var has_mfrac =
    mfrac[1].getBoundingClientRect().height -
      mfrac[0].getBoundingClientRect().height >
    30;
  return has_mfrac;
})();

